window.bookSummaryJSON = "<p>While on a visit to the United States, Pope Pius XIII is kidnapped by a terrorist cell calling itself the Soldiers of Islam. If the United States and its allies do not meet their demands, they will execute the pope. FBI Specialist Shari Cohen is called to duty to track down the terrorist cell responsible, and she soon learns that she is not alone. </p> <p>Deep behind the Vatican walls, a secret order dispatches a clandestine group of elite commandos known as the Vatican Knights. Their mission: bring the pope back alive. As Cohen and the Knights work in tandem they uncover a White House conspiracy involving high-ranking members on Capitol Hill. As Cohen begins to get too close to the truth about the pope's kidnapping, she becomes the target of indigenous forces trying to keep the conspiracy safe. However, in order to get to her they must first go through the Vatican Knights... </p>"; 
